const Search = () => {
  return (
    <div class='row'>
      <div class='input-field col s6'>
        <input id='artist' type='text' class='validate' />
        <label class='active' for='artist'>
          歌手
        </label>
        <input id='album' type='text' class='validate' />
        <label class='active' for='first_name2'>
          專輯
        </label>
      </div>
    </div>
  );
};

export default Search;
